const SearchBox = () => {
  searchChange = (event) => {
    console.log(event.target.value);
  }
  return (
    <div>
      <label>
        Search Robots:
        <input
          type='search'
          placeholder="search robots"
          onChange={searchChange}
        />
      </label>
    </div>
  )
}

export default SearchBox;
